import React from 'react'

const Main = () => {
  return (
  <div>
    <div className="flex items-center space-x-4 p-4">
  {/* Logo Image */}
  <div className="w-12 h-12">
    <img src="your-logo-url.png" alt="Logo" className="w-full h-full object-contain" />
  </div>

  {/* Name */}
  <div>
    <h1 className="text-xl font-semibold">Your Company Name</h1>
  </div>
</div>
  </div>
  )
}

export default Main
